const Navigation = () => {
    return (
      <nav className={styles.nav}>
        <ul>

            <li>
              <a href="/">Users</a>
            </li>


            <li>
              <a href="/">Admin</a>
            </li>

        </ul>
      </nav>
    );
  };

  export default Navigation;
